import React from 'react';
import Item from './Item.js';

const Results = (props) => {
    return (
        <ul>
            {props.items.map((item) => {
                return (
                    <Item 
                        key={this.item.id} 
                        onClick={this.removeItem(item.id)}
                    />)}
                )
            }
        </ul>
    )
}

export default Results;
